import React from 'react';
import PodcastCard from './PodcastCard';

class Popular extends React.Component {
    constructor(props) {
        super(props);
        }

    render() {
        console.log('popularpodcasts', this.props.podcasts);
        return (
            <div>
                {
                    this.props.podcasts.map(podcast => {
                        return <PodcastCard 
                            key={podcast.id}
                            id={podcast.id}
                            name={podcast.name}
                            
                        />
                    })
                }
            </div>
        )    
    }
    
}

export default Popular;
